import "./App.css"
import Nav from "./Nav;"
import Home from "./Home";
import About from "./About";
import Projects from "./Projects";
import ContactMe from "./ContactMe";


export default function App() {
  return (
    <div className="App">
      <Nav />
      <About/>
      <Projects />
    </div>
  );
}

